													set(level.player.animation, 'emote_raisedfinger'),
													level.player, [~Do you have any idea what just happened?\\nAny idea what I've been through?~],
	
													set(self.animation,'emote_talk'),  
													self, [~No.~],

													set(level.player.animation, 'emote_confused'),
													level.player, [~No?\\nWhat do you mean, no?~],													

													set(self.animation,'emote_confused'),
													self, [~I honestly completely lost you shortly after you\\nentered the swamp.  Completely.~],

													set(self.animation,'emote_talk'),
													self, [~This whole \"eyes in the sky\" thing\\ndoesn't work when everything's lost in the fog.~],

													set(level.player.animation, 'emote_confused'),
													level.player, [~How much do you know about\\nwhat I ran into down there?~],
													
													set(self.animation,'emote_confused'),
													self, [~I tracked you for the first few miles,\\nbut I lost you when you went in a cave.~],

													set(self.animation,'emote_talk'),
													self, [~I actually had a run in with some of the same\\nmushrooms you did, believe it or not.~],
													
													set(self.animation,'emote_confused'),
													self, [~They have quite a few fliers,\\nand they gave me a real chase.~],

													set(self.animation,'emote_talk'),
													self, [~I kept trying to dip back in to find you,\\nbut it was a big risk every time.~],

													set(self.animation,'emote_angry'),
													self, [~It did look like the mushrooms were\\ngetting bigger and meaner, every step of the way.~],

													set(self.animation,'emote_gesticulate'),
													self, [~There was a really nasty patch that\\nI just had to avoid entirely.~],

													set(level.player.animation, 'emote_nod'),
													level.player, [~And then you found me again, right?~],

													set(self.animation, 'emote_wry'),
													self, [~Something like that, yes.~],													
													
													
												
													set(level.player.animation, 'emote_geez'),
													level.player, [~Yeah.  \"Bigger and Meaner\" is no joke.\\nI think I ran into the mother of all mushrooms.~],

													set(level.player.animation, 'emote_oh'),
													level.player, [~I really hope they don't get any bigger than that.~],
														
													set(self.animation,'emote_talk'),  
													self, [~I'm wondering… did you kill it?~],
													
													set(level.player.animation, 'emote_confused'),
													level.player, [~Well, geez, buddy, I'm wondering that too.\\nI'm really not sure.~],													

													set(level.player.animation, 'emote_oh'),
													level.player, [~If these have anything in common with your\\n\"garden-variety\" mushrooms, you can't just\\nkill it by killing the head.~],													


													set(self.animation, 'emote_confused'),
													self, [~...~],
													
													level.player, [~...~],
													
													set(level.player.animation, 'emote_confused'),
													level.player, [~So <em>mayyybe</em> we should just get out of here…~],

													set(self.animation, 'emote_confused'),
													self, [~You don't say…\\nWell then!~],

													
													self, [~So, I was just scouting the area from above…~],
													set(self.animation,'emote_talk'),
													self, [~…and it looks like this is right\\nin the middle of the polluted region.~],
													set(self.animation,'emote_talk'),
													self, [~If you weren't in this particular cave,\\nyou'd have a nasty trip ahead of you.~],
													set(self.animation,'emote_wry'),
													self, [~You, however, are in luck, because this\\ntunnel leads up to a ridge.~],
													set(self.animation,'emote_talk'),
													self, [~It gets out of the swamp,\\nand the caves aren't far past that.~],
													set(self.facing, 1),
													set(self.animation,'emote_gesticulate'),
													self, [~Keep heading in this direction,\\nand you should find them.~],
													
													set(level.player.animation, 'emote_raisedfinger'),
													level.player, [~That is the best news I've heard all day!~],
													
													set(self.facing, 0),
													set(self.animation,'emote_wry'), 
													self, [~No problem.	 I'll be in touch!~]),
													
													level.player.store_event('berd_directions', 1)],
						  
									~Why do you care?~, [
										speech_dialog(
													set(level.player.animation, 'emote_geez'),
													level.player, [~Why do <em>you</em> care?\\nNot like you're taking any heat, here.~],
													
													set(self.animation,'emote_wry'),
													self, [~I … what?\\nI didn't get a good view of it, but-~],
													
													set(level.player.animation, 'emote_angry'),
													level.player, [~<em>I ALMOST DIED, OKAY?!?</em>~],
													
													set(self.animation,'emote_confused'),
													self, [~Well … yes?  I'm asking what happened…~],
													
													set(level.player.animation, 'emote_angry'),
													level.player, [~Yeah, you're just sitting here\\nwithout a care in the world.~],
													
													set(level.player.animation, 'emote_impatient'),
													level.player, [~Is this just a spectator sport, for you?!?\\nAm I just … <em>entertainment?</em>~],
													
													set(self.animation,'emote_angry'),
													self, [~I should think not!~],

													set(level.player.animation, 'emote_geez'),
													level.player, [~Really, huh?\\nThen why do I do all these fights, <em>solo</em>?~],
												
													set(self.animation,'emote_confused'),
													self, [~Because…	… oh dear.\\nAre we really having this argument?~],

													set(level.player.animation, 'emote_geez'),
													level.player, [~Yeah, because… ~],

													set(level.player.animation, 'emote_oh'),
													level.player, [~… well …~],

													set(level.player.animation, 'emote_confused'),
													level.player, [~… I'm really being a jerk, aren't I?~],

													set(self.animation,'emote_angry'),
													self, [~Just a bit.~],

													set(self.animation,'emote_wry'),
													self, [~I think I'm going to\\nlet you cool off for a bit.~]),level.player.store_event('berd_angry', 1)],

								],
